warp_hlsl:
shader_body
{
    // custom motion for 50% of the pixels...:
    float zoom = 0.84 + 0.05*cos(time*0.5);
    float2 uv2 = (uv_orig - 0.5)*zoom + 0.5;

    // make every other pixel use 'uv2':
    float2 pix = uv_orig * texsize.xy;
    float even_odd = saturate(2*frac((pix.x + pix.y)*0.5 + 0.25));
    uv = lerp(uv, uv2, even_odd);

    // sample previous frame
    ret = tex2D( sampler_main, uv ).xyz;

    // darken (decay) over time
    //ret = (ret - 0.0015)*0.988;
    ret *= 0.93 + 0.07*saturate(rad*5);
}

comp_hlsl:
shader_body
{
    uv *= 0.5;
    ret = tex2D(sampler_main, uv).xyz;
    ret = max(ret, tex2D(sampler_main,uv + float2(0.5,0)).xyz);
    ret = max(ret, tex2D(sampler_main,uv + float2(0,0.5)).xyz);
    ret = max(ret, tex2D(sampler_main,uv + float2(0.5,0.5)).xyz);
    ret *= 1.666;
ret=1.6-ret;
ret-=roam_sin.wzy*roam_cos.zxy;
